import React from 'react';

const Task = (props) => {
  const { text, date } = props.task;
  return (
    <div>
      <strong>{text}</strong> - do <span style={{ color: "blue" }}> {date}</span>
      <button>Zostalo zrobione</button>
    </div>
  );
}

export default Task;
